import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';

import ProjectPreview from "./ProjectPreview"

import NavBar from "./NavBar"
import GooglePage from "./GooglePage"

function App() {
  return (
    <Router>
      <div>

        <Route exact path="/" component={Home} />
        <Route exact path="/googlepage" component={GooglePage} />
      </div>
    </Router>

  );
}

function Home() {
  return (
    <div className="app">


      <div className="landing-page">
        <header className="app-header">
          <p className="nav-header">Welcome</p>
          <div className="header_title">
            <p className="header1">Hello, I'm Cathleen!</p>
            <p className="header1">I'm a designer-developer who believes in creating beautifully engineered products to empower people.</p>
            <a className="header1 link" href="">More about me &rarr;</a>

          </div>
        </header>

        <div className="projects">
          <ProjectPreview name="Uber" description="Product design" imgUrl={require("./assets/uber-preview.png")} side="project_preview_left"/>
          <ProjectPreview name="Homepointr" description="Design/Development" imgUrl={require("./assets/homepointr-preview.png")} side="project_preview_right"/>
          <ProjectPreview name="Google" description="UX Engineering" imgUrl={require("./assets/google-preview.png")} side="project_preview_left" link="/googlepage"/>
          <ProjectPreview name="Build the Future" description="Branding/Development" imgUrl={require("./assets/build-the-future-preview.png")} side="project_preview_right"/>
        </div>

      </div>


      <NavBar email="cathleenjia@berkeley.edu"/>


    </div>
  );
}

export default App;
